import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import { Router } from "react-router";
import routes from "./routes";

ReactDOM.render(
  <React.StrictMode>
    <Router routes={routes} />
  </React.StrictMode>,
  document.getElementById("root")
);
